import React, {  useState } from 'react';


function App(){

  const [num , setnum] = useState(0)



  function increment(){
    setnum(num + 1);

    alert("I am Clicked");
  }


  return(
    <button onClick={increment}>Click me {num}</button>
  )
}

export default App;
